import React from "react";
import Buttons from "../components/Buttons";

import Widget from "../components/Widget";
import { useNavigate } from "react-router-dom";

import ModalForm from "../components/ModalForm";
import ExpensePage from "./ExpensePage";
import DashboardIncomeTable from "../components/DashboardIncomeTable";
import DashboardExpensesTable from "../components/DashboardExpensetable";

const Dashboard = () => {
  const navigate = useNavigate();
  return (
    <>
      <Widget />
      <h3 className="dashboardTableHeader">Recent changes</h3>
      <div>
        <h4
          className="dashboardTableHeader"
          style={{
            backgroundColor: "#fc0303",
            color: "#ffff",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            width: "100vh",
          }}
        >
          Expenses
        </h4>
      </div>
      <DashboardIncomeTable />
      <DashboardExpensesTable />
      <ModalForm />
      <Buttons
        label="Expense Chat"
        handleClick={() => navigate("expense-page")}
      />
      <Buttons
        label="Income Chart"
        handleClick={() => navigate("income-page")}
      />
    </>
  );
};

export default Dashboard;
